import React from 'react';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from 'react-router-dom';
import {
  AppBar,
  Button,
  List,
  ListItem,
  ListItemIcon,
  ListItemText,
  Toolbar
  } from '@material-ui/core';
import { withStyles } from '@material-ui/core/styles';
import AppsIcon from '@material-ui/icons/Apps';
import WifiIcon from '@material-ui/icons/Wifi';
import PublicIcon from '@material-ui/icons/Public';


import ThreatMap from './ThreatMap';

const StyledButton = withStyles({
  root: {
    color: "white"
  }
})(Button);

function App(){
  return(
    <BrowserRouter>
      <AppBar color="primary" position="sticky">
        <Toolbar>
          <StyledButton component={Link} to="/">Demo App</StyledButton>
        </Toolbar>
      </AppBar>
      <div>
        <List>
          <ListItem>
            <ListItemIcon>
              <PublicIcon />
            </ListItemIcon>
            <ListItemText
                primary="Web Protection"/>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <AppsIcon />
            </ListItemIcon>
            <ListItemText primary="App Protection"/>
          </ListItem>
          <ListItem>
            <ListItemIcon>
              <WifiIcon />
            </ListItemIcon>
            <Button color="primary" component={Link} to="/network-threat-map">
                Network Protection
            </Button>
          </ListItem>
        </List>
        <Switch>
          <Route path='/network-threat-map'>
            <ThreatMap />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
};

export default App;
